import Qs from "qs";
import { getTimeDate } from "@/utils/index.js";
import UserInfo from "./infoDialog";
export default {
  components: {
    UserInfo: UserInfo
  },
  filters: {
    statusFilter: function statusFilter(status) {
      var statusMap = {
        true: "success",
        draft: "gray",
        deleted: "danger"
      };
      return statusMap[status];
    }
  },
  data: function data() {
    return {
      dialogTableVisible: false,
      selectTaskData: {},
      list: null,
      listLoading: true,
      form: {
        type: "",
        id: "",
        userId: "",
        password: "",
        userName: "",
        phone: ""
      },
      rules: {
        type: [{
          required: true,
          trigger: "blur",
          message: "请选择账号类型"
        }],
        userId: [{
          required: true,
          trigger: "blur",
          message: "请输入账号ID"
        }],
        userName: [{
          required: true,
          trigger: "blur",
          message: "请输入账号名称"
        }],
        password: [{
          required: true,
          trigger: "blur",
          message: "请输入账号密码"
        }]
      }
    };
  },
  created: function created() {
    this.fetchData();
  },
  methods: {
    formatTime: function formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    submitForm: function submitForm(formName) {
      var _this = this;

      this.$refs[formName].validate(function (valid) {
        if (valid) {
          var rols = [{
            id: null,
            roleId: _this.form.type,
            status: "1"
          }];
          var param = {
            base: JSON.stringify({
              id: _this.form.id,
              userName: _this.form.userName,
              userId: _this.form.userId,
              password: _this.form.password,
              checkPassword: _this.form.password,
              wxNum: "",
              mail: "",
              phone: _this.form.userId,
              region: ""
            }),
            roles: JSON.stringify(rols)
          };

          _this.axios.post(_this.urls.addadmin + "?" + Qs.stringify(param)).then(function (response) {
            _this.$refs[formName].resetFields();

            _this.fetchData();
          });
        } else {
          console.log("error submit!!");
          return false;
        }
      });
    },
    fetchData: function fetchData() {
      var _this2 = this;

      this.listLoading = true;
      this.axios.get(this.urls.getalladminlist).then(function (response) {
        _this2.list = response.data;
        _this2.listLoading = false;
      });
    },
    deleteh: function deleteh(item) {
      var _this3 = this;

      this.$confirm("是否确认删除?", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(function () {
        var param = {
          id: item.id
        };

        _this3.axios.delete(_this3.urls.delateadmin + "?" + Qs.stringify(param)).then(function (response) {
          _this3.fetchData();
        });
      });
    },
    //查询
    lookinfo: function lookinfo(row, index) {
      this.dialogTableVisible = true;
      this.selectTaskData = row;
    },
    editDialogListener: function editDialogListener(bol) {
      this.dialogTableVisible = bol;
    }
  }
};
